import React from 'react';
export default function Home() {
    return (
        <div style={{ padding: 40, textAlign: 'center' }}>
            <img src="/logo-grande.png" alt="Logo StoryUp" style={{ width: 180, marginBottom: 24 }} />
            <h1>StoryUp</h1>
            <p>Red social escolar para Docentes y Alumnos. Regístrate o inicia sesión para comenzar.</p>
        </div>
    );
}
